import React from "react";
import { Row, Col, Button, Typography } from "antd";
import {
	WidthImg,
	Texty,
	Paragraphy,
	ActionBtn,
	FooterContainer,
} from "../assets/css/style_result";

function Footer() {
	return (
		<>
			<FooterContainer>
				<WidthImg
					src={require("../assets/images/result/ldd_burnt.png")}
				/>

				<Texty top={10} font={20}>
					귀여움이 세상을 구한다!
				</Texty>

				<Texty top={10} font={10}>
					라는 슬로건으로 러브둥둥 채널을 운영하며, 귀여운 모든 것을
					만화로 표현하고 있습니다.
				</Texty>

				<div style={{ height: "30px" }}></div>

				<Texty top={10} font={10}></Texty>
			</FooterContainer>

			<div style={{ height: "200px" }}></div>

			<Texty top={10} font={10}>
				제작
			</Texty>

			<Texty top={10} font={10}>
				기획: 빅픽쳐 팀 &nbsp;
				<a mailto="project@bigpicture.team">project@bigpicture.team</a>
			</Texty>

			<Texty top={10} font={10}>
				기획: 오지현 &nbsp;
				<a mailto="jeehyeon__@naver.com">jeehyeon__@naver.com</a>
			</Texty>

			<Texty top={10} font={10}>
				개발: 윤희상 &nbsp;
				<a mailto="huisang.growth@gmail.com">
					huisang.growth@gmail.com
				</a>
			</Texty>

			<div style={{ height: "30px" }}></div>
		</>
	);
}

export default Footer;
